svg.script:
var clock = function(element){
    var angle = 36;
    return function(){
        element.setAttribute("transform", `rotate(${angle}, 102, 175)`);
        angle += 36;
    }
}
window.addEventListener("load", function() {
    var svg = document.getElementById('diller-gruppen');
    clock.element = svg
    const bb = svg.getBoundingClientRect()
    setInterval(clock(svg), 3000)
});
